import React from 'react'


function SeriesMenus() {
    return (
        <div className="sms-menu">
            <div><p>Matches</p></div>
            <div><p>Squads</p></div>
            <div><p>Stats</p></div>
            <div><p>Venus</p></div>
            <div><p>Points</p></div>
        </div>
    )
}

export default SeriesMenus
